import Busboy = require('busboy');
import fs = require('fs');
import path = require('path');
import os = require('os')
import { Request as ExpressRequest, ParamsDictionary, NextFunction, Response  } from "express-serve-static-core";

type uploadBusboy = (request: ExpressRequest<ParamsDictionary>, response: Response, next: NextFunction)=>void
interface UploadBusboyFile {
    fieldname: string
    file: NodeJS.ReadableStream | undefined
    filename: string;
    destination: string;
    encoding?: string,
    mimetype?: string
    fileWrite: ()=>fileWrite
}
type fields = { [key: string]: string }
type fileWrite = Promise<fs.WriteStream>
type fileWrites = fileWrite[]
type uploads = { [key: string]: string[] }
type files = { [key: string]: UploadBusboyFile[] }

type onFile<T, R> = (dep: T) => (
    fieldname?: string,
    file?: NodeJS.ReadableStream,
    filename?: string,
    encoding?: string,
    mimetype?: string) => R

type onField<T> = (dep: T) => (
    fieldname?: string,
    val?: any,
    fieldnameTruncated?: boolean,
    valTruncated?: boolean,
    encoding?: string,
    mimetype?: string) => T

declare global {
    namespace Express {
        interface Request {
            busboy: {
                uploads: ()=>uploads,
                fileWrites: ()=>fileWrites,
                fields: ()=>fields,
                files: ()=>files,
            };
            rawBody: any
        }
    }
}

const tmpdir = os.tmpdir();
const storeUploads: onFile<uploads, uploads> =
    (uploads) =>
        (fieldname, file, filename) => {
            if (!fieldname || !filename) { }
            else {
                uploads[fieldname] = [
                    path.join(tmpdir, filename),
                    ...(uploads[fieldname] || [])
                ];
            }
            return uploads;
        }
const storeFields: onField<fields> =
    (fields) =>
        (fieldname, val) => {
            if (!fieldname || !val) { }
            else fields[fieldname] = val
            return fields;
        }

const storeFileWrite: onFile<
    fileWrites,
    ((uploads?: uploads) => fileWrites)
> =
    (fileWrites) =>
        (fieldname, file, filename) =>
            (uploads) => {
                if (!fieldname || !filename || !file || !uploads) { }
                else {
                    const { [fieldname]: [destination] } = uploads;
                    const writeStream = fs.createWriteStream(destination);
                    file.pipe(writeStream);
                    fileWrites = [
                        new Promise((resolve, reject) => {
                            file.on('end', () => {
                                writeStream.end();  // File was processed by Busboy
                            });
                            writeStream.on('finish', resolve);
                            writeStream.on('error', reject);
                        }),
                        ...fileWrites
                    ];
                }
                return fileWrites;
            }

const storeFile: onFile<
    files,
    ((uploads?: uploads) => ((fileWrites?: fileWrites) => files))
> = (files) =>
        (fieldname, file, filename, encoding, mimetype) =>
            (uploads) =>
                (fileWrites) => {
                    if (!fieldname || !filename || !file || !uploads || !fileWrites) { }
                    else {
                        const { [fieldname]: [destination] } = uploads;
                        const [fileWrite] = fileWrites;
                        files[fieldname] = [
                            ...(files[fieldname] || []),
                            {
                                fieldname,
                                filename,
                                encoding,
                                mimetype,
                                file,
                                destination,
                                fileWrite:()=>fileWrite
                            }
                        ]
                    }
                    return files
                }
export const uploadBusboy: uploadBusboy = (request, response, next) => {
    const busboy = new Busboy({ headers: request.headers });
    const fields = storeFields({});
    const uploads = storeUploads({});
    const fileWrites = storeFileWrite([]);
    const files = storeFile({});

    busboy.on('field', (fieldname, val) => fields(fieldname, val));
    busboy.on('file', (fieldname, file, filename, encoding, mimetype) => {
        files(fieldname, file, filename, encoding, mimetype)(
            uploads(fieldname, file, filename)
        )(
            fileWrites(fieldname, file, filename)(uploads())
        )
    });
    busboy.on('finish', async () => {
        try {
            request.busboy = {
                fields: ()=>fields(),
                uploads: ()=>uploads(),
                fileWrites: ()=>fileWrites()(),
                files: ()=>files()()(),
            }
            next(null)
        } catch (e) {
            next(e);
        }
    });

    busboy.end(request.rawBody);
}
